import React, { useEffect } from 'react'

export default function Comp53() {
  useEffect(() => {
    fetch("https://fakestoreapi.com/product")
      .then((response) => response.json())
      .then((data) => console.log(data));
  })
  return (
    <div>Comp53</div>
  )
}
